import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className="div-center">
      <ul>
        <li>
          <Link to="/">Home</Link>{' '}
        </li>
        <li>
          <Link to="/users/login">Login</Link>{' '}
        </li>
        <li>
          <Link to="/users/signup">Sign Up</Link>{' '}
        </li>
        <li>
          <Link to="/users/details">Personal Details</Link>{' '}
        </li>
      </ul>
      Navbar{' '}
    </div>
  );
};

export default Navbar;
